import { useState, useEffect } from "react";

const MostrarProducto = (dato) => {
  const [data, setData] = useState("");

  useEffect(() => {
    fetch("http://localhost:3001/single_product/")
      .then((res) => res.json())
      .then((data) => setData(data));
  });
  console.log(dato);
  return "mostrar";
};

export default MostrarProducto;
